import React from "react";
import{Movie} from "../features/movie/movieSlice"
import "./HomePage.css"

export default function HomePage(props:any) {
    const movie:Movie = props.movie;
    return <div>
        <h1 className={"title"}>NEFLIX</h1>  
        <div className={"child_Home"}>
            <h4>{movie.title}</h4>
            </div>       
    </div>
}
